const propTypes = {
  dates: PropTypes.arrayOf(PropTypes.string).isRequired
};
const defaultProps = {};

export default function TimeBar({ dates }) {
  return (
    <section className="w-100 h5">
      {/* {dates &&
        dates.forEach(element => {
          helo;
        })} */}

      <RangeSelector
        min={0}
        max={24}
        step={24}
        direction="horizontal"
        color="dark"
        value={5}
        size="medium"
        className="bg-blue"
      />
    </section>
  );
}

TimeBar.propTypes = propTypes;
TimeBar.defaultProps = defaultProps;
